                    <Logo>
                        <a href='/'>Kove.</a>
                    </Logo>
                    <Nav>
                        <span></span>
                        <span></span>
                    </Nav>
                </Row>
            </Container>
        </HeaderContainer>
    );
}

const HeaderContainer = styled.div`
    border: 1px solid red;
    position: fixed;
    width: 100%;
    height: 128px;
    z-index: 69;
    @include media("<=phone") {
        height: 96px;
    }
`;
