    border: 1px solid purple;
`;
const Row = styled.div`
    border: 1px solid pink;
`;
const Logo = styled.div`
    border: 1px solid green;
    a {
        text-decoration: none;
        font-size: 1.2rem;
    }
`;

const Nav = styled.div`
    border: 1px solid green;

    span {
    }
`;

export default Header;
